const TickIcon = () => {
  return (
    // SVG element representing a tick icon (checkmark inside a circle)
    <svg
      className="tick" 
      xmlns="http://www.w3.org/2000/svg" 
      width="25" 
      height="25" 
      viewBox="0 0 512 512"> {/* Set the coordinate system for the SVG */}

      <title>ionicons-v5-e</title> {/* Title for accessibility and description */}

      {/* Circle shape (used for the background of the checkmark) */}
      <path d="M448,256c0-106-86-192-192-192S64,150,64,256s86,192,192,192S448,362,448,256Z" />

      {/* Checkmark symbol inside the circle */}
      <polyline points="352 176 217.6 336 160 272" />
    </svg>
  )
}

export default TickIcon
